import React from 'react';
import styled from 'styled-components';

const HeadlineBlock = styled.div`
  padding-top: 48px;
  padding-left: 32px;
  padding-right: 32px;
  padding-bottom: 24px;
  border-bottom: 1px solid #e9ecef;
  h1 {
    margin: 0;
    font-size: 36px;
    color: #343a40;
  }
  .day {
    margin-top: 4px;
    color: #868e96;
    font-size: 21px;
  }
`;

function Headline() {
  return (
    <HeadlineBlock>
      <h1>2019년 7월 10일</h1>
      <div className="day">수요일</div>
    </HeadlineBlock>
  );
}

export default Headline;
